    false,nt"url": null,nt"notes": "This annual narrative report for Muscatatuck
    NWR outlines Refuge accomplishments during the 1975 fiscal year. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover conditions during the year. Wildlife including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, mammals, and reptiles
    is also covered. The Refuge development and maintenance section discusses physical
    developments and plantings. A progress report on field investigations and applied
    research is also provided. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, hunting, and violations.
    Items of interest, NR forms, and photographs are attached.",nt"license_title":
